  return (
    <div>
      <header className="bg-warning text-center py-4">
        <h1>Salvando Vidas Desde 1997</h1>
      </header>
      <div className="container">
        <div className="row">
          <Sidebar />
          <AnimalList />
        </div>
      </div>
    </div>
  );
};

export default App;
